import React, { useState }from 'react'
import Homes from '../Homes'
import '../styles/ListingCards.css';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';


const ListingCards = () => {

    const [isLoading ] = useState(false)

    if (isLoading) {
        return <div>
                    <h1 className='loader'>Loading... </h1>
                </div>;
    }

    return (
        <motion.div >
             <motion.div>
            {Homes.map(home => (
                <motion.div className='listing-card'>
                    <img className='listing-image' src={home.image} alt=''></img>

                    <motion.div className='listing-card-info'>
                        <h3>${home.price}</h3>
                        <p>{home.listing_status}</p>
                        <h6>{home.location} | {home.address}</h6>
                        <p className='listing-card-p'>Bed: {home.bedrooms} | Bath: {home.bath} | {home.footage} Sq Ft | {home.lot_size} Acre(s)</p>
                        <Link to='/viewsinglehome'>
                            <button className='custom-button'>view property</button>
                        </Link>
                    </motion.div>
                </motion.div>
            ))}

            </motion.div>
        </motion.div>

    )
}

export default ListingCards
